import React, { useState, useEffect } from 'react';
import AddBookForm from './components/AddBookForm';
import BookList from './components/BookList';
import axios from 'axios';

const App = () => {
  return (
    <div style={{ padding: '2rem' }}>
      <h1>My Books:</h1>
      <AddBookForm />
      <hr />
      <BookList />
    </div>
  );
};

export default App;
